import React, { useEffect, useState } from "react";
import { fetchDoctorProfile } from "../services/api";
import "../styles/Profile.css";

const Profile = ({ profileId = 1 }) => {
  const [profileData, setProfileData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const getProfile = async () => {
      try {
        const data = await fetchDoctorProfile(profileId);
        setProfileData(data[0]); // Assuming API returns an array
        setLoading(false);
      } catch (err) {
        setError(err);
        setLoading(false);
      }
    };

    getProfile();
  }, [profileId]);

  if (loading) {
    return <div className="profile-container">Loading...</div>;
  }

  if (error) {
    return <div className="profile-container">Error: {error}</div>;
  }

  return (
    <div className="profile-container">
      <div className="profile-header">
        <img
          src={
            profileData.profile_pic
              ? profileData.profile_pic
              : "https://via.placeholder.com/150"
          }
          alt="Profile Pic"
          className="profile-pic"
        />
        <div className="profile-info">
          <h1>{profileData.name}</h1>
          <p className="degree">{profileData.degree}</p>
          <p className="expertise">Top Expertise: {profileData.top_expertise}</p>
          <p className="experience">{profileData.experience} years of experience</p>
        </div>
      </div>

      <div className="profile-details">
        <h2>Details</h2>
        <p><strong>Phone:</strong> {profileData.phone_number}</p>
        <p><strong>Hospital:</strong> {profileData.hospital}</p>
        <p><strong>Address:</strong> {profileData.address}</p>
        <p><strong>Available Days:</strong> {profileData.available_days}</p>
        <p><strong>Timings:</strong> {profileData.available_timings}</p>
        <p><strong>Fees:</strong> ${profileData.fees}</p>
      </div>

      <div className="profile-services">
        <h2>Services</h2>
        <ul>
          {profileData.services.map((service) => (
            <li key={service.id}>{service.service_name}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Profile;
